// src/App.js
import React from 'react';
import Header from './Header';
import Sidebar from './Sidebar';
import Calendar from './Calendar';

const App = () => {
  return (
    <div style={styles.app}>
      <Header />
      <div style={styles.mainContent}>
        <Sidebar />
        <Calendar />
      </div>
    </div>
  );
};

const styles = {
  app: {
    display: 'flex',
    flexDirection: 'column',
    height: '100vh',
  },
  mainContent: {
    display: 'flex',
    flex: 1,
  },
};

export default App;
